import React from "react";

function Skills(props) {
  console.log(props);
  const PersonSkills = props.skills.map((skill) => <li>{skill}</li>);
  return (
    <div>
      <h3>Skills</h3>
      <ul>{PersonSkills}</ul>
    </div>
  );
}

export default Skills;
